      | 47616 -> { ItemTypeData.id= 47616; name= "Drake Navy Issue Octopus Orange Flight SKIN (Permanent)"; published= true; description= "The Caldari Navy's 37th (Octopus) Squadron has a long and storied history stretching back to the Caldari-Gallente War that led to independence for the Caldari State. Originally a frigate squadron established during the war, the 37th is notable as a capsuleer unit within the Caldari Navy.    Octopus Squadron's  Orange Flight  is an outgrowth of the older  Red Flight  after reorganization of this elite capsuleer squadron. The Orange Flight operates advanced missile cruisers in the heavy assault role, providing devastating and flexible long-range firepower to the 37th."; marketGroupId= Some(2103); groupId= 1950; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
